"original": |2-
     The root element of NLSML is <result>.  Optional child elements are
     <interpretation>, <enrollment-result>, and <verification-result>, at
     least one of which must be present.  A single <result> MAY contain
     any or all of the optional child elements.  Details of the <result>
     and <interpretation> elements and their subelements and attributes
"fixed": |-
  The root element of NLSML is <result>.  Optional child elements are <interpretation>, <enrollment-result>, and <verification-result>, at least one of which must be present.  A single <result> MAY contain any or all of the optional child elements.  Details of the <result> and <interpretation> elements and their subelements and attributes
"ko": |-
  NLSML의 루트 요소는 <result>입니다. 선택적인 자식 요소는 <interpretation>, <enrollment-result>, <verification-result>이며, 이 중 적어도 하나는 있어야 합니다. 단일 <result>는 선택적인 자식 요소 중 하나 또는 전부를 포함할 수 있습니다. <result> 및 <interpretation> 요소와 하위 요소 및 속성에 대한 세부 정보
